package com.AustinPilz.FridayThe13th.Components.Enum;

public enum F13Skin
{

    JASON("", ""),
    JASON_Part1("", ""),
    JASON_Part2("", ""),
    JASON_Part3("", ""),
    JASON_Part4("", ""),
    JASON_Part5("", ""),
    JASON_Part6("", ""),
    JASON_Part7("", ""),
    JASON_Part8("", ""),
    JASON_Part9(" ", ""),
    COUNSELOR_BASE("", ""),
    COUSENLOR_BLOOD_1("", ""),
    COUSENLOR_BLOOD_2("", ""),
    COUSENLOR_BLOOD_3("", ""),
    ORIGINAL("", "");

    private String value, signature;

    F13Skin(String value, String signature) {
        this.value = value;
        this.signature = signature;
    }

    public String getValue() {
        return value;
    }

    public String getSignature() {
        return signature;
    }

    public void setValue(String value) {
        this.value = value;
    }

    public void setSignature(String signature) {
        this.signature = signature;
    }
}